import React from 'react'
import { useParams } from 'react-router-dom'


function Collection(){

    let {slug} = useParams();

    function hello(){
        return "My collection"
    }

    return(
        <div>
            <h1>{hello()}</h1>
            <p>page {slug}</p>
        </div>
    )
}

export default Collection;
